import React from "react";
import Card from "./Card";
export default function CardList({anggotas}){
    return(
        <>
        {
            anggotas.length === 0 ? <h3>Anggotas is empty</h3> : anggotas.map(anggota =>{
                return(
                    <div className="col-md-2">
                    <Card/>
                    </div>
                )
            })
        }
        <div className="row">
            <div className="col-md-2">
                <Card/>
            </div>
            <div className="col-md-2">
                <Card/>
            </div>
            <div className="col-md-2">
                <Card/>
            </div>
            <div className="col-md-2">
                <Card/>
            </div>
            <div className="col-md-2">
                <Card/>
            </div>
            <div className="col-md-2">
                <Card/>
            </div>
        </div>
        </>
    )
}
